import React, { useState } from 'react';
import {
  Container,
  Paper,
  Typography,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Button,
  Chip,
} from '@mui/material';

interface Request {
  type: string;
  employee: string;
  items: string;
  status: 'Pending' | 'Approved' | 'Rejected';
}

const initialRequests: Request[] = [
  {
    type: 'Equipment',
    employee: 'user@example.com (Normal User)',
    items: 'Laptop (x1)',
    status: 'Pending',
  },
  {
    type: 'Leave',
    employee: 'admin@example.com (Admin User)',
    items: 'Vacation (x5)',
    status: 'Approved',
  },
];

const Requests = () => {
  const [requests] = useState<Request[]>(initialRequests);

  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      <Paper sx={{ p: 2 }}>
        <Typography variant="h6" gutterBottom>
          REQUESTS
        </Typography>
        <TableContainer>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Type</TableCell>
                <TableCell>Employee</TableCell>
                <TableCell>Items</TableCell>
                <TableCell>Status</TableCell>
                <TableCell>Actions</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {requests.map((request, index) => (
                <TableRow key={index}>
                  <TableCell>{request.type}</TableCell>
                  <TableCell>{request.employee}</TableCell>
                  <TableCell>{request.items}</TableCell>
                  <TableCell>
                    <Chip
                      label={request.status}
                      color={
                        request.status === 'Approved'
                          ? 'success'
                          : request.status === 'Pending'
                          ? 'warning'
                          : 'error'
                      }
                    />
                  </TableCell>
                  <TableCell>
                    <Button variant="contained" size="small">
                      Edit
                    </Button>
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
        <Button
          variant="contained"
          color="primary"
          sx={{ mt: 2 }}
        >
          Add Request
        </Button>
      </Paper>
    </Container>
  );
};

export default Requests;
